import logo from './logo.svg';
import './App.css';
const eejs = require('ep_etherpad-lite/node/eejs/'); 
const settings = require('ep_etherpad-lite/node/utils/Settings');

exports.eejsBlock_editbarMenuRight = function (hook_name, args, cb) { args.content = eejs.content="foo"; return cb(); };

let api1 = require('etherpad-lite-client')
let etherpad = api1.connect({
  apikey: 'UcCGa6fPpkLflvPVBysOKs9eeuWV08Ul',
  host: 'localhost',
  port: 3000,
})

etherpad.createGroup(function(error, data) {
  if(error) alert('Error creating group: ' + error.message)
  else console.log('New group created: ' + data.groupID)
})

var args = {
  groupID: 'g.yJPG7ywIW6zPEQla',
  padName: 'testpad',
  text: 'Hello world!',
}
etherpad.createGroupPad(args, function(error, data) {
  if(error) alert('Error creating pad: ' + error.message)
  else console.log('New pad created: ' + data.padID)
})


function App() {
  return (
    <div className="App">

      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />



        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
